css:
kite-login {
  font-size: 1.2em;
  padding: 2.5em 2em 2em;
  margin: auto;
  display: block;
}
kite-login svg {
  width: 100px;
  height: 45px;
  position: absolute;
  right: 2em;
  top: 0.5em;
}
kite-login svg path {
  fill: #d7dae0;
}
kite-login a {
  cursor: pointer;
}
kite-login .pull-right {
  margin-left: 10px;
}
kite-login:not(.password-less) .no-password {
  display: none;
}
kite-login.password-less .has-password {
  display: none;
}
kite-login .form-status {
  margin-top: 10px;
}
kite-login .form-status.hidden {
  display: none;
}
kite-login .form-status:empty {
  display: none;
}
